import React from 'react';
import { useSelector } from 'react-redux';

const SettingPage = () => {
  const user = useSelector((state) => state.userStore.user)
  return (
    <React.Fragment>
      <p>{user.name}</p>
    </React.Fragment>
  );
};

export default SettingPage;
